create table tinsel_ornaments
(
    Id      int          not null
        primary key,
    Name    varchar(255) null,
    NameId  int unsigned not null,
    Visible tinyint      not null,
    AssetId int          not null,
    IconId  int          not null,
    Rarity  int          not null,
    `Order` int          not null
)
    engine = MyISAM
    charset = utf8;

